import React from "react";
import "./Home.css";
import Product from "./Product";

function Home() {
  return (
    <div className="home">
      <div className="home__container">
        <img className="home__image" src="bgimg.jfif" alt="" />

        <div className="home__row">
            <Product 
            id="12321241"
            title="The lean startup"
            price={29.99}
            image="https://th.bing.com/th/id/OIP.uoID0lUaYA-O7NGAUmNb1gAAAA?w=203&h=306&c=7&r=0&o=5&dpr=1.3&pid=1.7"
            rating={5}
            />
            <Product 
             id="49538094"
             title="Kenwood KMix Stand Mixer"
             price={239.0}
             image="https://th.bing.com/th/id/OIP.Oqix_DKFlgcqOLhHQgVWOgHaJ4?w=150&h=200&c=7&r=0&o=5&dpr=1.3&pid=1.7"
             rating={3}
            />
        </div>

        <div className="home__row">
        <Product/>
        <Product/>
        <Product
        id="3254354345"
        title="New Apple iPad Pro(12.9-inch)"
        price={98.99}
        image="data:image/jpeg;base64,"
        rating={4}
        />
        </div>

        <div className="home__row">
        <Product/>
        </div>
      </div>
    </div>
  );
}

export default Home;
